import React, {useRef} from 'react'
import Togglable from './Togglable'
const Blog = ({blog}) => {
  const blogRef = useRef()

  return (
  <div key={Math.random()}>
    {blog.title} {blog.author}
    <Togglable ref={blogRef} openButtonLabel='info' closeButtonLabel='hide'>
      <div>
        <p>id: {blog.id}</p>
        <p>url: {blog.url}</p>
        <div>
          <p>likes: {blog.likes}</p><button>like</button>
        </div>
        <p>it be working</p>
      </div>
    </Togglable>
  </div>  
)}

export default Blog
